import React from "react";

const ListGroup = (props) => {
  const { items } = props;
  return (
    <div>
      <ul className="list-group">
        {items.map((item) => {
          <li className="list-group-item">{item.name}</li>;
        })}
      </ul>
    </div>
  );
};

export default ListGroup;
